import React, {useEffect, useState} from "react";
import majorService from "../services/majorService";
import {json, Link, NavLink, useNavigate, useParams} from "react-router-dom";
import productService from "../services/productService";
import {Nav} from "react-bootstrap";
import data from "bootstrap/js/src/dom/data";
import $ from 'jquery';
// import 'slick-carousel/slick/slick.css';
// import 'slick-carousel/slick/slick-theme.css';

const Product = (props) => {
    const [products, setProducts] = useState([]);
    const [attributes, setAttributes] = useState([]);
    const [imageExtension, setImageExtension] = useState([]);
    const [imageExtension2, setImageExtension2] = useState([]);
    const [currentCategory, setCurrentCategory] = useState([]);
    const [blogs, setBlogs] = useState([]);
    const navigate = useNavigate();
    const { id,category } = useParams();

    const sliderItems1 = imageExtension.map((aImageExtension, idx) => (
            <div className={`slick-item gallery__image jws-image-zoom  `}
                 key={idx}
                 data-thumb={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=768`}>                                                                        <img
                    className="img-responsive "
                src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
                alt="Chân váy midi xòe xếp ly họa tiết caro"
                data-src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
            />
            </div>
        )
    );
    const sliderItems2 =  imageExtension.map((aImageExtension, idx) => (
                <div className="thumb1" data-id={idx} key={idx}>
                    <img
                        className={`thumb js-thumb ${idx === 0 ? 'selected' : ''}`}
                        src={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=150`}
                        alt={products.title}
                        width="78"
                    />
                </div>
            )
        );
    // $("#product-thumbnails .thumbnails").not(".slick-initialized").on("init", function(slick) {
    //     $("#product-thumbnails").css({
    //         visibility: "visible",
    //         opacity: "1"
    //     })
    // }).slick({
    //     slidesToShow: 4,
    //     slidesToScroll: 1,
    //     centerMode: 1,
    //     asNavFor: "#product-images",
    //     arrows: !1,
    //     vertical: !0,
    //     focusOnSelect: !0,
    //     accessibility: !1,
    //     waitForAnimate: !0,
    //     transformEnabled: !1,
    //     responsive: [{
    //         breakpoint: 480,
    //         settings: {
    //             slidesToShow: 5,
    //             slidesToScroll: 1,
    //             centerMode: !0,
    //             asNavFor: "#product-images",
    //             arrows: !1,
    //             vertical: !1,
    //             focusOnSelect: !0,
    //             accessibility: !1,
    //             waitForAnimate: !0,
    //             transformEnabled: !1,
    //         },
    //     }, ],
    // })
    useEffect(() => {
        productService.get(category,id).then((res) => {
            setProducts(res.data);
            setAttributes(res.data_attribute);
            setCurrentCategory(res.currentCategory);
            setBlogs(res.items_blog);
            setImageExtension(JSON.parse(res.data.image_extension).map((aImageExtension, idx) => (
                    <div className={`slick-item gallery__image jws-image-zoom  `}
                         key={idx}
                         data-thumb={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=768`}>                                                                        <img
                        className="img-responsive "
                        src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
                        alt="Chân váy midi xòe xếp ly họa tiết caro"
                        data-src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
                    />
                    </div>
                )
            ));
            setImageExtension2(JSON.parse(res.data.image_extension).map((aImageExtension, idx) => (
                    <div className={`slick-item gallery__image jws-image-zoom  `}
                         key={idx}
                         data-thumb={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=768`}>                                                                        <img
                        className="img-responsive "
                        src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
                        alt="Chân váy midi xòe xếp ly họa tiết caro"
                        data-src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}
                    />
                    </div>
                )
            ));
            var slickProductThumb = function() {
                var countThumb = 0;
                var centerMode = !1;
                var containerThumb = $("#product-thumbnails .thumbnails img");
                if (containerThumb.length <= 1) {
                    countThumb = 1
                } else if (containerThumb.length > 4) {
                    countThumb = 4
                } else {
                    countThumb = containerThumb.length - 1
                }
                $("#product-thumbnails .thumbnails").not(".slick-initialized").on("init", function(slick) {
                    $("#product-thumbnails").css({
                        visibility: "visible",
                        opacity: "1"
                    })
                }).slick({
                    slidesToShow: countThumb,
                    slidesToScroll: 1,
                    centerMode: centerMode,
                    asNavFor: "#product-images",
                    arrows: !1,
                    vertical: !0,
                    focusOnSelect: !0,
                    accessibility: !1,
                    waitForAnimate: !0,
                    transformEnabled: !1,
                    responsive: [{
                        breakpoint: 480,
                        settings: {
                            slidesToShow: 5,
                            slidesToScroll: 1,
                            centerMode: !0,
                            asNavFor: "#product-images",
                            arrows: !1,
                            vertical: !1,
                            focusOnSelect: !0,
                            accessibility: !1,
                            waitForAnimate: !0,
                            transformEnabled: !1,
                        },
                    }, ],
                })
            };
            var slickProductImg = function() {
                $("#product-images").not(".slick-initialized").on("init", function(slick) {
                    $("#product-images .slick-item").css({
                        display: "block"
                    });
                }).slick({
                    slidesToScroll: 1,
                    slidesToShow: 1,
                    asNavFor: "#product-thumbnails .thumbnails",
                    fade: !0,
                    prevArrow: '<span class="ti-angle-left"></span>',
                    nextArrow: '<span class="ti-angle-right"></span>',
                    centerMode: !1,
                    transformEnabled: !1,
                    waitForAnimate: !1,
                    responsive: [{
                        breakpoint: 767,
                        settings: {
                            slidesToShow: 1,
                            slidesToScroll: 1,
                            asNavFor: null,
                            fade: !1,
                            vertical: !1,
                            centerMode: !1,
                            focusOnSelect: !1,
                            accessibility: !1,
                            arrows: !1,
                            dots: !0,
                        },
                    }, ],
                });
                $(".trigger-zoom").length && $(".trigger-zoom").unbind("click").on("click", function(e) {
                    openPhotoswipe(e)
                });
                if ($(".photoswipe").length) {
                    $("#product-images .photoswipe").on("click", function(e) {
                        openPhotoswipe(e)
                    })
                }
                $(document).on("click", ".thumb1.slick-slide", function(e) {
                    $(".watch-video").removeClass("active");
                    $(".thumbnails").removeClass("video-active")
                });
                $(document).on("click", ".watch-video a", function(e) {
                    $("#product-images").slick("slickGoTo", 0);
                    $("#product-images .slick-item.play-video .button-play-video").hide()
                });
                $(document).on("click", "#product-images .slick-item.play-video .button-play-video", function(e) {
                    $(this).hide();
                    $(this).parent().find("video").get(0).play()
                });
                $("#product-images").on("afterChange", function(event, slick, currentSlide, nextSlide) {
                    let currentItem = $(this).find(".slick-current");
                    if (currentItem.hasClass("play-video")) {
                        $(this).find(".slick-current video").get(0).play()
                    }
                })
            };
            $("#product-thumbnails .thumbnails").not(".slick-initialized").on("init", function(slick) {
                $("#product-thumbnails").css({
                    visibility: "visible",
                    opacity: "1"
                })
            }).slick({
                slidesToShow: 4,
                slidesToScroll: 1,
                centerMode: !1,
                asNavFor: "#product-images",
                arrows: !1,
                vertical: !0,
                focusOnSelect: !0,
                accessibility: !1,
                waitForAnimate: !0,
                transformEnabled: !1,
                responsive: [{
                    breakpoint: 480,
                    settings: {
                        slidesToShow: 5,
                        slidesToScroll: 1,
                        centerMode: !0,
                        asNavFor: "#product-images",
                        arrows: !1,
                        vertical: !1,
                        focusOnSelect: !0,
                        accessibility: !1,
                        waitForAnimate: !0,
                        transformEnabled: !1,
                    },
                }, ],
            })
            function openPhotoswipe(e) {
                e.preventDefault();
                var pswpElement = $(".pswp")[0],
                    items = getGalleryItems($(".gallery__image")),
                    eventTarget = $(e.target),
                    clicked;
                clicked = eventTarget.closest(".woocommerce-product-gallery__image");
                var options = $.extend({
                    index: $(clicked).index(),
                }, {
                    shareEl: !1,
                    closeOnScroll: !1,
                    history: !1,
                    hideAnimationDuration: 0,
                    showAnimationDuration: 0,
                });
                var photoswipe = new PhotoSwipe(pswpElement, PhotoSwipeUI_Default, items, options);
                photoswipe.init()
            }
        });
    }, [category,id, navigate]);

    return (
        <>

            {/*breadcrums*/}
            <div className="page-header single-breadcrums hidden-sm-down" style={{paddingTop: "160px"}}>
                <div className="page-breadcrumbs">
                    <nav data-depth="4" className="breadcrumbs">
                        <ol itemScope="" itemType="http://schema.org/BreadcrumbList">
                            <li itemProp="itemListElement" itemScope="" itemType="http://schema.org/ListItem">
                                <a itemProp="item" href="https://www.kkfashion.vn/">
                                    <span itemProp="name">Trang chủ</span>
                                </a>
                                <meta itemProp="position" content="1" />
                                <span className="sep">/</span>
                            </li>
                            {
                                currentCategory.title?(
                                    <li itemProp="itemListElement" >
                                        <Link to={`/${currentCategory.slug}`} >
                                            <span >{currentCategory.title}</span>
                                        </Link>
                                        <meta itemProp="position" content="2"  />
                                        <span className="sep">/</span>
                                    </li>
                                ):(
                                    <></>
                                )
                            }
                            {
                                products.title?(
                                    <li itemProp="itemListElement" >
                                        <Link to="#" >
                                            <span >{products.title}</span>
                                        </Link>
                                        <meta itemProp="position" content="2"  />
                                    </li>
                                ):(
                                    <></>
                                )
                            }
                        </ol>
                    </nav>
                </div>
            </div>


            <div className="content">
                <div className="container">
                    <section id="main">
                        <div className="row">

                                    <div className="content-product-left col-md-6 col-sm-7 col-xs-12">
                                        <section className="page-content" id="content">
                                            <div className="product-images-content">
                                                <div className="images-container"></div>
                                                    <div className="product-cover blance-images">
                                                        <a className="trigger-zoom" href="javascript:;"></a>
                                                        <figure className="slicker" id="product-images">

                                                            {/*{ imageExtension.map((aImageExtension, idx) => (*/}
                                                            {/*        <div className="slick-item gallery__image jws-image-zoom"*/}
                                                            {/*             key={idx}*/}
                                                            {/*             data-thumb={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=768`}>                                                                        <img*/}
                                                            {/*            className="img-responsive "*/}
                                                            {/*            src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}*/}
                                                            {/*            alt="Chân váy midi xòe xếp ly họa tiết caro"*/}
                                                            {/*            data-src={`https://shop.decor.tichhop.pro/storage${aImageExtension}`}*/}
                                                            {/*        />*/}
                                                            {/*        </div>*/}
                                                            {/*    )*/}
                                                            {/*)}*/}
                                                            {imageExtension}

                                                        </figure>
                                                    </div>


                                                    <div className="product-thumbnails" id="product-thumbnails">
                                                        <div className="thumbnails columns-3">

                                                            {/*{ imageExtension.map((aImageExtension, idx) => (*/}
                                                            {/*        <div className="thumb1" data-id={idx} key={idx}>*/}
                                                            {/*            <img*/}
                                                            {/*                className={`thumb js-thumb ${idx === 0 ? 'selected' : ''}`}*/}
                                                            {/*                src={`https://shop.decor.tichhop.pro/storage${aImageExtension}?w=150`}*/}
                                                            {/*                alt={products.title}*/}
                                                            {/*                width="78"*/}
                                                            {/*            />*/}
                                                            {/*        </div>*/}
                                                            {/*    )*/}
                                                            {/*)}*/}
                                                            {imageExtension2}

                                                        </div>
                                                    </div>
                                            </div>
                                        </section>
                                    </div>

                            <div className="content-product-right col-md-6 col-sm-5 col-xs-12">
                                <div className="shop-top">
                                    <h1 className="product_title" itemProp="name">Chân váy midi xòe xếp ly họa tiết
                                        caro</h1>
                                    <p className="sku"><span className="fontutm">Mã SP : </span><span>CV05-17</span></p>
                                    <div className="product-prices price">
                                        <div className="product-price h5">
                                            <div className="current-price">
                                                <span className="amount" itemProp="price" content="390000">390.000 ₫</span>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="product-information">
                                    <div className="product-actions shop-bottom js-product-actions">
                                        <form action="https://www.kkfashion.vn/cart" method="post"
                                              id="add-to-cart-or-refresh">
                                            <input type="hidden" name="token" value="835acac5685788a8960ebc94aa75607f"/>
                                            <input type="hidden" name="id_product" value="3977"
                                                   id="product_page_product_id"/>
                                            <input type="hidden" name="id_customization" value="0"
                                                   id="product_customization_id"/>
                                            <div className="product-variants">
                                                <div className="clearfix product-variants-item">
                                                    <div className="size-wrap">
                                                        <label><span>Size</span></label>

                                                        <label className="opt-size" data-size="S">
                                                            <input data-product-attribute="1" name="group[1]"
                                                                   className="opt" type="radio" value="65"/>
                                                            <span className="opt-real">S</span>
                                                        </label>
                                                        <label className="opt-size" data-size="M">
                                                            <input data-product-attribute="1" name="group[1]"
                                                                   className="opt" type="radio" value="66"/>
                                                            <span className="opt-real">M</span>
                                                        </label>
                                                        <label className="opt-size" data-size="L">
                                                            <input data-product-attribute="1" name="group[1]"
                                                                   className="opt" type="radio" value="67"/>
                                                            <span className="opt-real">L</span>
                                                        </label>
                                                        <label className="opt-size" data-size="XL">
                                                            <input data-product-attribute="1" name="group[1]"
                                                                   className="opt" type="radio" value="68"/>
                                                            <span className="opt-real">XL</span>
                                                        </label>
                                                    </div>

